import React , {useEffect, useState} from 'react';
import DataTable from 'react-data-table-component';
import Axios from 'axios';
import {ManagerNavBar} from "../components/ManagerNavBar";

export const Legacy = ()=> {

    //Necessary variables
    const [legTDList, setlegTDList] = useState([]);

    //required methods

    const showlegacyTD = ()=>{
        Axios.get("http://localhost:3005/legacy").then((response)=> {
            setlegTDList(response.data);
        });
    };


    //Render page code

    return (
        <div>
            <h1>Manager</h1>
            {<ManagerNavBar/>}
            <hr></hr>
            <div>
                <h1>Legacy test drives</h1>
                <button onClick = {showlegacyTD}>Show legacy testdrives</button>
                    {legTDList.map( (val, key)=> {
                    return <div className='legacy_td'>
                                <label>Customer Name</label><h2>{val.name}</h2>
                                <label>Customer Address</label><h2>{val.addr}</h2>
                                <label>Customer Mobno</label><h2>{val.cust_mobno}</h2>
                                <label>Vehicle Model</label><h2>{val.model}</h2>
                                <label>Transmission Type</label><h2>
                                        {val.type == 'a' && "Automatic"}
                                        {val.type == 'm' && "Manual"}
                                    </h2>
                                <label>Executive Name</label><h2>{val.exe_name}</h2>
                                <label>Executive Mob No</label><h2>{val.exemobno}</h2>
                                <label>Booking Date</label><h2>{val.td_date}</h2>
                                <label>Time Slot</label><h2>{val.slot_name}</h2>
                                <hr></hr>
                            </div>
                                
                    })}
            </div>
        </div>
    );
}
